import React from "react";
import { useDispatch } from "react-redux";

import { setIsStartScreenToShow } from "../store/questionaireSlice";

export const ResultScreen = ({ results }) => {
  const dispatch = useDispatch();
  console.log("results", results);
  return (
    <div>
      results screen
      {results?.length &&
        results.map((resultItem, index) => (
          <div key={`${resultItem.question}-${index}`}>
            {resultItem.isCorrectAnswer.toString()}` `{resultItem.question}
          </div>
        ))}
      <button
        type="submit"
        onClick={() => {
          dispatch(setIsStartScreenToShow(true));
        }}
      >
        TRUE
      </button>
    </div>
  );
};
